import me from './mee.jpg';
import './App.css';
import Navbar from './Navbar';
import ConsoleWindow from './Console';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
            <div className="overflow-x-hidden"> {/* Apply 'overflow-x-hidden' class */}
      <div className="flex justify-between">
        <div className="w-72">
          <Navbar />
          <p className="mt-10">Hi there, Shubhada here</p>
          <img src={me} className="me" alt="Image" />
        </div>
        {/* <div>sdsdasd</div> */}
        <div className="w-1/4 flex flex-col  border-l border-gray-300"> {/* Add border to create a separating line */}
            <ConsoleWindow />
        </div>
      </div>
      </div>
    </div>
    </Router>
  );
}

export default App;
